import Link from 'next/link';

const Nav = () => (
    <div>
        <img src="/static/bat-logo.png" alt="bat logo" height="35" />
        <Link href="/"><a>Home</a></Link>
        <br/>
        <Link href="/about"><a>About</a></Link>
    </div>
);

export default Nav;
